var chosen={};chosen.init=function(e,n){$(".chosen-select").chosen();for(var c,t,o=0;o<e.length;o++)t=-1===e[o].indexOf("#")?"#"+e[o]:e[o],t=t.replace(/-/g,"_"),c=t+"_chosen",$(c).width(parseInt(n[o]))},chosen.single_update=function(e){var e=-1===e.indexOf("#")?"#"+e:e;$(e).val("").trigger("chosen:updated")},chosen.all_update=function(){$(".chosen-select").val("").trigger("chosen:updated")};